import React from "react";
import SUCCESSIMAGE from '../assest/success.gif'

const success = () => {
    return (
        <div className="bg-slate-200 w-full max-w-md mx-auto">
            <img src={SUCCESSIMAGE}
                width={150}
                height={150}
            />
        </div>
    )
};

export default success;
